import React from 'react';
import Grid from '@material-ui/core/Grid';
import Card from 'react-bootstrap/Card';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Styles from '../../Styles/ULView/';

export default class ULView extends React.Component {

    render() {
        const { data, lng, lngTranslations } = this.props;
        const Translations = lngTranslations[this.constructor.name];
        return(
            <Grid
                container
                justify="center"
                style={Styles.mainRow}
            >
                <Grid item xs sm md lg>
                    <Card
                        bg="light"
                        key="1"
                        text="dark"
                    >
                        <Card.Header style={Styles.cardHeader}>
                            {Translations[data.title]}
                        </Card.Header>
                        <Card.Body style={Styles.cardBody}>
                            <List dense={true} style={{
                                textAlign: "center"
                            }}>
                                <ListItem>
                                    <ListItemText
                                        primary="Single-line item"
                                        secondary="Secondary text"
                                    />
                                </ListItem>
                            </List>
                        </Card.Body>
                    </Card>
                </Grid>
            </Grid>
        )
    }

}
